import React, { Component } from 'react'
import { Button } from 'antd';
import { DownloadOutlined } from '@ant-design/icons';
import './App.css'

export default class App extends Component {
  render() {
    return (
      <>
        <Button className='right' type="primary" value="large">Primary Button</Button>
        <Button className='right' >Default Button</Button>
        <Button className='right' type="dashed">Dashed Button</Button>
        <Button className='right' type="text">Text Button</Button>
        <Button className='right' type="link">Link Button</Button>
      </>
    )
  }
}
